import React from 'react';
import styles from '../Styles/styles.css'
import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link,
    NavLink,
    Redirect
} from "react-router-dom";

const handleSubmit = () => {
    return (
        <Router>
            <Switch>
                <Route exact path="/Dashboard" />
            </Switch>
        </Router>
    )
}
